syntax = "proto3";



import "SceneRouteChangeInfo.proto";

message SceneRouteChangeNotify {
	enum IJOCHFEAPBP {
		option allow_alias = true;
		NONE = 0;
		PEPPOHPHJOJ = 201;
		DCDNILFDFLB = 0;
		NNBKOLMPOEA = 1;
	}

	uint32 sceneId = 10;
	repeated SceneRouteChangeInfo routeList = 12;
	uint32 sceneTime = 6;
}
